import React from 'react'

const Skill = ({level}) => {
    const max = 4
    let test = []
    let num = parseInt(level)
    for (let i = 0; i < level; i++) {
        test.push(`<div>ela</div>`)
    }
    let result = test.map(item => <div>{item}</div>)
    console.log(test)
    for (let j = level; j < max; j++){
        result.push('non')
    }
    console.log(result)
    return (
        <div className="skillbar">
            {result}
        </div>
    )
}
export default Skill
